def authDb(user):
    bought = False
    tester = False
    reqUsers = requests.get(
        f'https://mangahack-c9113-default-rtdb.firebaseio.com/.json')
    for key, value in reqUsers.json().items():
        if "user" in str(key).strip() and user == str(value):
            bought = True
        if "tester" in str(key).strip() and user == str(value):
            tester = True
    if bought == True:
        print("Usuário autenticado no MangaHack.\n")
    elif tester == True:
        print("Você entrou em modo teste.\n")
    else:
        print("Você ainda não pagou pelo APP\n")
        exit()


