def getItemIdActiv(activitiesToDo, cookie):
    aux = []
    req = requests.get(
        f'https://campus.mangahigh.com/participate/lesson/{activitiesToDo["activ"][0]}', headers=cookie)
    for i in range(0, 3):
        aux.append(req.json()["questions"]["E"][i]["itemId"])
    for i in range(0, 3):
        aux.append(req.json()["questions"]["M"][i]["itemId"])
    for i in range(0, 3):
        aux.append(req.json()["questions"]["H"][i]["itemId"])
    aux.append(req.json()["questions"]["X"][0]["itemId"])
    return aux


def getItemId(activitiesToDo, cookie):
    print(activitiesToDo)
    itemId = []
    if len(activitiesToDo["activ"]) > 0:
        if len(activitiesToDo["activ"]) == 1:
            aux = getItemIdActiv(activitiesToDo, cookie)
            itemId.append(aux)

        elif len(activitiesToDo["activ"]) > 1:
            for i in activitiesToDo["activ"]:
                aux = getItemIdActiv(activitiesToDo, cookie)
                itemId.append(aux)
    return itemId


def auth(user, pwd, school):

    # credenciais para a request
    jsonCred = {"schoolId": school, "password": pwd, "persistent": "true",
                "timezone": "America/Sao_Paulo", "username": user}

    # request
    authReq = requests.post(
        "https://api.mangahigh.com/auth", data=dumps(jsonCred))

    # seta o status code
    statusCode = authReq

    # seta o headers da resposta
    resHeaders = authReq.headers

    # seta o cookies
    cookies = resHeaders["set-cookie"]

    # pega o json da resposta
    resAuth = authReq.json()

    # verifica se ta tudo certo
    if f"{statusCode}" == "<Response [201]>" or f"{statusCode}" == "<Response [200]>":
        print("\nUsuário autenticado no MangaHigh.\n")
    else:
        print("Algo deu errado.\n")

    return resHeaders, resAuth, cookies


def getActivities(headers, url):

    # faz a request
    resLesson = requests.get(url, headers=headers)

    # verifica se ta tudo certo
    if f"{resLesson}" == "<Response [201]>" or f"{resLesson}" == "<Response [200]>":
        print("Atividades coletadas.\n")
    else:
        print("Algo deu errado.\n")
        print(resLesson)
        print(resLesson.json())
    return resLesson.json()


